import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import '../CadastroUsuario.css'; // Import custom CSS file
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { Button, Col, Container, Form, Row } from "react-bootstrap";

function HomePage({ apiURL, form, setForm }) {
  const navigate = useNavigate();
  const path = "/auth/register";
  const url = `${apiURL}${path}`;


  const handleChange = (e) => {
    //monitoramento dos inputs
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // requisição axios.post
      await axios.post(url, form);
      // navegação para a página de funcionários
      navigate("/listarClientes");
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    setForm({
      username: "",
      password:"",
      role:""
    
    });
  }, []);


  return (
    <Container>
      <p />
      <h2>Cadastrar Novo Proprietário</h2>
      <Form onSubmit={handleSubmit}>
        <Row>
          <Col>
            <Form.Group className="mb-3">
              <Form.Label>Nome do Proprietário</Form.Label>
              <Form.Control
                required
                type="text"
                placeholder="UserName"
                name="username"
                value={form.username}
                onChange={handleChange}
              />
            </Form.Group>
          </Col>
          <Col>
            <Form.Group className="mb-5">
              <Form.Label>Número da matrícula</Form.Label>
              <Form.Control
                required
                type="password"
                placeholder="Insira a Senha"
                name="password"
                value={form.password}
                onChange={handleChange}
              />
            </Form.Group>
          </Col>
        </Row>
       
       
       
       
        <p />
        <Button
          variant="secondary"
          onClick={() => navigate(-1)}
          style={{ margin: "10px" }}
        >
          Voltar
        </Button>
        <Button variant="success" type="submit">
          Cadastrar
        </Button>
        <p />
      </Form>
    </Container>
  );
}

export default HomePage;
